import React from "react";
import styled from "styled-components";

export default function MainHeadquater() {
  return (
    <div>
      <MainContainer>
        <MainBranchMediacan>
          <p>Medicana Hospital</p>
        </MainBranchMediacan>
        <DetailsOfMainBranch>
          <Information>
            <p>
              Headquaters of Medicana is located in Uttarakhand. Our Hospital is
              one of the best hospitals located in Uttarakhand. We have a team
              of expert doctors that take care of patient's health properly. We
              maintain all the hygiene and proper sanitation to keep the
              hospital clean. The staff behaviour is very good with proper
              knowledge. we will assist you at Our best.
            </p>
          </Information>
          <BranchInfromation>
            <p>Their are total 5 branches of Medicana Hospital </p>
          </BranchInfromation>
          <Branch1container>
            <p>Branch 1 (Medicana Hospital)</p>
          </Branch1container>
          <BranchInformationDetial>
            <DetailContainer>
              <p>
                Lorem ipsum dolor sit amet consectetur adipisicing elit.
                Provident quaerat, alias enim debitis quae a soluta ut
                voluptatum, aut maiores sed minus nostrum!
              </p>
            </DetailContainer>
            <ImgContainer>
              <img src="/ImagesForTreatmentPage/BacgroundImage1.jpg" alt="MyHospitalWebste" />
            </ImgContainer>
          </BranchInformationDetial>
        </DetailsOfMainBranch>
      </MainContainer>
    </div>
  );
}

const MainContainer = styled.div`
  width: 90%;
  position: relative;
  left: 80px;
  top: 40px;
  text-align: center;
  border: 2px solid green;
`;

const MainBranchMediacan = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  margin: 3%;

  p {
    text-align: center;
    font-family: "Bree Serif", serif;
    font-size: 2rem;
    color: white;
    font-weight: bold;
    display: inline-flex;
    padding: 10px;
    box-shadow: rgba(0, 0, 0, 0.1) 0px 2px 4px, rgba(0, 0, 0, 0.1) 0px 8px 16px;
    background-color: rgb(255, 255, 255);
    color: #090b13;
    border-radius: 5px;
    word-spacing: 0.5rem;
    line-height: 1.4rem;
  }
`;

const DetailsOfMainBranch = styled.div`
  box-shadow: rgba(0, 0, 0, 0.1) 0px 2px 4px, rgba(0, 0, 0, 0.1) 0px 8px 16px;
  border-radius: 5px;
  background-color: white;
`;

const Information = styled.div`
  display: flex;
  flex-direction: column;
  flex-wrap: wrap;
  align-items: center;
  justify-content: center;
  margin: 3%;
  p {
    text-align: center;
    color: #090b13;
    font-family: "Roboto", sans-serif;
    word-spacing: 0.5rem;
    line-height: 1.4rem;
  }
`;

const BranchInfromation = styled.div`
  display: flex;
  flex-direction: column;
  flex-wrap: wrap;
  align-items: center;
  justify-content: center;
  margin: 3%;

  p {
    text-align: center;
    font-family: "Bree Serif", serif;
    font-size: 1.7rem;
    color: white;
    font-weight: bold;
    display: inline-flex;
    padding: 10px;
    box-shadow: rgba(0, 0, 0, 0.1) 0px 2px 4px, rgba(0, 0, 0, 0.1) 0px 8px 16px;
    background-color: rgb(255, 255, 255);
    color: #090b13;
    border-radius: 5px;
    word-spacing: 0.5rem;
    line-height: 1.4rem;
  }
`;

const Branch1container = styled.div`
  display: flex;
  align-items: flex-start;
  p {
    text-align: center;
    font-family: "Bree Serif", serif;
    font-size: 1.7rem;
    color: white;
    font-weight: bold;
    display: inline-flex;
    padding: 10px;
    box-shadow: rgba(0, 0, 0, 0.1) 0px 2px 4px, rgba(0, 0, 0, 0.1) 0px 8px 16px;
    background-color: rgb(255, 255, 255);
    color: #090b13;
    border-radius: 5px;
    word-spacing: 0.5rem;
    line-height: 1.4rem;
    margin: 10px;
  }
`;

const BranchInformationDetial = styled.div`
  border: 2px solid green;
`;

const DetailContainer = styled.div`
  border: 2px solid pink;
`;

const ImgContainer = styled.div`
  border: 2px solid blue;
`;
